import React from "react";
import Map from "./Map";
import Weather from "./Weather";
import Movies from "./Movies";
import axios from "axios";
import { Container, Modal, Form, Button } from "react-bootstrap";

class Main extends React.Component {
  constructor() {
    super();
    this.state = {
      displayInfo: false,
      showModal: false,
      searchInput: "",
      location: {},
      locationResults: [],
      weatherResults: [],
      movieResults: [],
      error: null,
    };
  }

  handleSearchInput = async (e) => {
    let searchResult = e.target.value;
    this.setState(
      {
        searchInput: searchResult,
      },
      () => console.log(this.state.locationResults)
    );
  };

  handleLocationSearch = async () => {
    try {
      let request = {
        locationUrl: `https://us1.locationiq.com/v1/search?key=${process.env.REACT_APP_LOCATION_KEY}&q=${this.state.searchInput}&format=json`,
        method: "GET",
      };

      let response = await axios(request);
      this.setState({
        locationResults: response.data[0],
      });
    } catch (error) {
      this.setState({
        showModal: true,
      });
    }
  };

  handleWeatherSearch = async () => {
    try {
      let weatherUrl = `${process.env.REACT_APP_SERVER}/weather?searchQuery=${this.state.locationResults}`;
      let response = await axios.get(weatherUrl);
      this.setState({
        weatherResults: response.data,
      });
    } catch (error) {
      this.setState({
        showModal: true,
      });
    }
  };

  handleMovieSearch = async () => {
    try {
      let moviesUrl = `${process.env.REACT_APP_SERVER}/movies?searchQuery=${this.state.locationResults}`;
      let response = await axios.get(moviesUrl);
      this.setState({
        movieResults: response.data,
      });
    } catch (error) {
      this.setState({
        showModal: true,
      });
    }
  };

  displayLocation = async (e) => {
    e.preventDefault();
    try {
      await this.handleLocationSearch();
      await this.handleWeatherSearch();
      await this.handleMovieSearch();
      this.setState({
        displayInfo: true,
        location: this.state.locationResults,
      });
    } catch (error) {
      this.setState({
        showModal: true,
      });
    }
  };

  closeModal = () => {
    this.setState({
      showModal: false,
    });
  };

  render() {
    console.log(this.state);
    return (
      <main>
        <div className="container">
          <form className="main-form" onSubmit={this.displayLocation}>
            <div className="form-group">
              <label htmlFor="city">City</label>
              <input type="text" id="city" onInput={this.handleSearchInput} />
            </div>
            <button className="main-button" onClick={displa}>
              Explore!
            </button>
          </form>
        </div>
        {displayInfo && (
          <>
            <h2>{location.display_name}</h2>
            <p>Lat: {location.lat}</p>
            <p>Lon: {location.lon}</p>
            <div className="map-container">
              <Map lat={location.lat} lon={location.lon} />
            </div>
            <div className="weather-container">
              {weatherResults.length > 0 && (
                <Weather weatherResults={weatherResults} />
              )}
            </div>
            <div className="movies-container">
              {movieResults.length > 0 && (
                <Movies movieResults={movieResults} />
              )}
            </div>
          </>
        )}
        <div className="modal-container">
          <div className={`modal ${showModal ? "show" : ""}`}>
            <div className="modal-content">
              <div className="modal-header">
                <h2>Error</h2>
                <button className="close-button" onClick={closeModal}>
                  &times;
                </button>
              </div>
              <div className="modal-body">
                <p>
                  The information you've entered is not valid. Please try again.
                </p>
              </div>
            </div>
          </div>
        </div>
      </main>
    );
  }
}

export default Main;
